a:260:{i:0;a:1:{s:2:"id";s:19:"2390997448398223276";}i:1;a:1:{s:10:"short_code";s:11:"CEuh4LipDes";}i:2;a:1:{s:12:"created_time";i:1599249128;}i:3;a:1:{s:7:"caption";s:2254:"NOTÍCIA❗️ Ku Hye Sun lançou novas músicas pela primeira vez em cinco anos.

Em 2 de setembro, Ku Hye Sun lançou seu terceiro álbum de piano new age "Breath 3". Este é seu primeiro lançamento desde “Breath 2” em 2015.

Quando questionado sobre que tipo de álbum é “Breath 3”, Ku Hye Sun compartilhou: “É um álbum que fiz enquanto me lembrava do ar especialmente fresco da primavera de 2020. Ele contém a excitação nervosa de um novo sonho e um novo começo. Se meus álbuns anteriores lidaram com o significado das estações da vida e da morte, este álbum lida com as emoções revigorantes da vida. ”
Como ela agora lançou uma trilogia de álbuns "Breath", ela falou sobre o significado desse termo, compartilhando: "Respirar é música e minha música tem o significado de respiração. É meu desejo que minha música seja tão confortável e necessária quanto respirar. ”

Depois de trabalhar como atriz, artista, diretora e muito mais, Ku Hye Sun compartilhou como ela veio a usar a música como outra forma de se expressar. Ela explicou: “Você não precisa explicar a música em palavras e a música tem o poder misterioso de compartilhar emoções. Como todos amam e abraçam a música, pensei: ‘Tenho que promover com música’. Acho que, de todos os meus projetos, esse pode ser o que mais mantém meu desejo de me comunicar com o público. Espero que ‘Breath 3’ possa transferir a empolgação esperançosa que senti em 2020 para o público. ”

Entre outros projetos de arte e freqüentando a escola, Ku Hye Sun foi questionada sobre como ela administra seu dia-a-dia agitado. Ela comentou: “Hoje em dia, passo cada dia muito ocupada. Minimizei substancialmente meu tempo de sono para cerca de duas horas por dia e continuo trabalhando. Estou escrevendo e trabalhando em arte para minha exposição marcada para o próximo ano. Há muito que preciso trabalhar, então estou dividindo bem meu tempo. Vou definir meu alarme para duas horas e, mesmo que esteja apenas cochilando, vou dormir duas horas e depois acordo para trabalhar. Apesar disso, estou transbordando de felicidade por começar do zero e poder trabalhar. ”
