Um grupo de espiões chamado 5446 Corps foi treinado por forças especiais de elite norte-coreanas desde a juventude, ostensivamente em direção ao objetivo de unificar a Coréia. Eles são enviados ambiciosamente para a Coréia do Sul, onde cada um se disfarça de tolo, aspirante a cantor e estudante do ensino médio. Passando um tempo chato sem receber ordens do Norte, eles gradualmente se acostumam à vida como vizinhos comuns em uma cidade pequena até que um dia, suas vidas mundanas são viradas de cabeça para baixo quando uma missão “secreta e grande” é repentinamente atribuída a eles.
